import React from 'react';
import HistoryIcon from '../HistoryIcon/HistoryIcon';
import "./HistoryItem.css";

function HistoryItem(item){
   
        return (
            <>
                <div className="HistoryItems">
                    <a href="123" className="history-link">
                        <img 
                            alt={item.name} 
                            className="HistoryImg" 
                            src={this.state.item.img}
                        />
                        <p className="title">{item.name}</p>
                        <p className="text">{item.author}</p>
                    </a>
                   
                        <HistoryIcon/> 
                      
                </div>
            </>
        );
}

export default HistoryItem(item);
